import React, { Component } from 'react'
import { countryModule } from './../../services/countryService'

export class countryDropDown extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             countryList:[]
        }
    }

    componentWillMount = ()=>{
        const countryList = countryModule.getCountry()
        this.setState({countryList:countryList})
    }
    
    render() {
        if(!Object.keys(this.state.country).length){
            return (
                <div>
                    
                </div>
            );
        }
        return (
            <div>
                <select name="gender">
                {
                   this.state.country.map((countryList , index) => {
                       return(
                        <option value="Male">Male</option>
                       )
                    })
                }
                </select>
                
            </div>
        )
    }
}

export default countryDropDown
